import './Portfolio.css';
import Image from './Image/Image';
import img1 from './Resource/-(1).jpg';
import img2 from './Resource/-(2).jpg';
import img3 from './Resource/-(3).jpg';
import img4 from './Resource/-(4).jpg';
import img5 from './Resource/-(5).jpg';
import img6 from './Resource/-(6).jpg';
import img7 from './Resource/-(7).jpg';
import img8 from './Resource/-(8).jpg';
import img9 from './Resource/-(9).jpg';
import img10 from './Resource/-(10).jpg';
import img11 from './Resource/-(11).jpg';
import img12 from './Resource/-(12).jpg';
import img13 from './Resource/-(13).jpg';
import img14 from './Resource/-(14).jpg';
import img15 from './Resource/-(15).jpg';
import img16 from './Resource/-(16).jpg';
import img17 from './Resource/-(17).jpg';
import img18 from './Resource/-(18).jpg';
import img19 from './Resource/-(19).jpg';
import img20 from './Resource/-(20).jpg';
import img21 from './Resource/-(21).jpg';
import img22 from './Resource/-(22).jpg';
import img23 from './Resource/-(23).jpg';
import img24 from './Resource/-(24).jpg';
import img25 from './Resource/-(25).jpg';
import img26 from './Resource/-(26).jpg';

const portfolio = (props) => {
    var c1 = [img1,img2,img3,img4,img5,img6, img7, img8, img9];
    var c2 = [img10,img11,img12,img13,img14,img15, img16, img17,img18];
    var c3 = [img19,img20, img21,img22,img23, img24,img25,img26];
    var c4 = [img19,img20, img21,img22];
    var c5 = [img23, img24,img25,img26];
    
    var all = c1.concat(c2).concat(c3);
    var images = [
        <Image click={props.click} app={props.app} images={c1} series={all}/>,
        <Image click={props.click} app={props.app} images={c2} series={all}/>,
        <Image click={props.click} app={props.app} images={c3} series={all}/>
    ];
    if(window.innerWidth<800)
        images = [
            <Image key="1" click={props.click} app={props.app} images={c1} series={all}/>,
            <Image key="2" click={props.click} app={props.app} images={c2} series={all}/>,
            <Image key="3" click={props.click} app={props.app} images={c4} series={all}/>,
            <Image key="4" click={props.click} app={props.app} images={c5} series={all}/>
        ];

    return(
        <div className="PortfolioRow">
            {images}
        </div>
    );
};

export default portfolio;
